description:
This first volume of Steven Universe is all about discovery. Steven is still an over-enthusiastic boy and more often than not, that gets in the way of his progress towards becoming a Gem. However, little by little, episode by episode he learns more about the Crystal Gems, their secrets, their history and the full extent of their powers. (Shape shifting anyone?) But of course, Steven being Steven, sometimes this new information leads to some Steven-y situations that no one, not even the Gems saw coming.

Frybo: Steven helps a Boardie kid with his grueling job by using a magical gem shard that can bring clothing to life.

Cat Fingers: Steven attempts to master the power of shape shifting, but can only shape shift his fingers into tiny cat heads.


